issing or non-finite values\n","yoga_filtered <- yoga %>%\n","  filter(!is.na(viewCount), !is.na(commentCount), is.finite(viewCount), is.finite(commentCount)) %>%\n","  filter(viewCount <= viewCount_threshold)\n","\n","# Calculate correlation coefficient\n","correlation <- cor(yoga_filtered$viewCount, yoga_filtered$commentCount, use = \"complete.obs\")\n","\n","# Create a scatter plot with filtered data and correlation line\n","scatter_plot <- ggplot(yoga_filtered, aes(x = viewCount, y = commentCount)) +\n","  geom_point(color = \"#78B1E5\") +\n","  geom_smooth(method = \"lm\", se = FALSE, color = \"red\", linetype = \"dashed\") +\n","  labs(x = \"View Count\", y = \"Comment Count\", title = \"Correlation between View Count and Comment Count \\n (Outliers Filtered)\") +\n","  annotate(\"text\", x = max(yoga_filtered$viewCount), y = max(yoga_filtered$commentCount), \n","           label = paste(\"Correlation:\", round(correlation, 2)), \n","           hjust = 1, vjust = 1, color = \"black\", size = 4) +\n","  scale_fill_manual(values = youtube_yoga_theme) +\n","  custom_yoga_theme_nolegend()\n","\n","scatter_plot"]},{"cell_type":"code","execution_count":36,"id":"2892df65","metadata":{"execution":{"iopub.execute_input":"2024-04-12T19:06:18.157787Z","iopub.status.busy":"2024-04-12T19:06:18.155541Z","iopub.status.idle":"2024-04-12T19:06:18.554013Z","shell.execute_reply":"2024-04-12T19:06:18.551176Z"},"papermill":{"duration":0.44547,"end_time":"2024-04-12T19:06:18.55813","exception":false,"start_time":"2024-04-12T19:06:18.11266","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`geom_smooth()` using formula = 'y ~ x'\n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ3wc1b038P/MbF9Jq1XvliVZli33jgtgbGxDqMGAQ2iB3JuEhEASEiC590kI\nuQm53Jt6QygBQkyAhF5iwMbG2LgbF7lKsnrv2tVq+8w8L2a2SNpdr5q1Hv2+H7+QZ2d2zzlT\n9rdn5swwoigSAAAAAFz8VETEC4LL653okgAAAADAyGlVKhURu